import React from "react";
import Home from "./pages/Home";
import Navbar from "./components/Navbar";

function App() {
  return (
    <div style={{ minHeight: "100vh", background: "#ffffff" }}>
      <Navbar />
      <div style={{ maxWidth: "1200px", margin: "0 auto", padding: "40px 20px" }}>
        <Home />
      </div>
    </div>
  );
}

export default App;
